const Conversation = [

	{
		character: "line orochi",
		line: "전지전능한 아마테라스, 당신은 정말 세상 사람들이 당신을 사랑하는 것처럼, 세상 사람들을 사랑하는가? "
	},

	{
		character: "line amaterasu",
		line: "나는 세상 사람들이 나를 사랑하는 것보다 그들을 더 사랑합니다."
	},

	{
		character: "line orochi",
		line: "그럼 왜 그들을 태어나게 내버려두고, 그들이 고통받도록 내버려두며, 나아가 그들을 재판하여 벌을 받게 하는가?"
	},

    {
		character: "line amaterasu",
		line: "그들이 죄악에 물들었기 때문입니다."
	},

    {
		character: "line orochi",
		line: "죄악? 당신은 참으로 전지전능하구나! 이 세상의 죄악은 도대체 어디에서 오는가?"
	},

    {
		character: "line orochi",
		line: "당신이 세상을 창조했는데, 그들을 죄악의 침식에서 벗어나게 할 수 없단 말인가? 할 수 없다면, 당신은 무엇 때문에 신들의 신인 것인가?"
	},

    {
		character: "line orochi",
		line: "인정해라, 이것들은 모두 당신의 거짓말에 불과하다. 당신은 본래 죄악을 없앨 능력이 없다."
	},
    
    {
		character: "line orochi",
		line: "왜냐하면—당신이야말로, 죄악의 근원이기 때문이다!"
	},
	
];

export default Conversation;
